import React from 'react';

const ReservedTravel = ({ travelID, flight_ids, usedCompanies, visitedPlanets, flightDistance, flightDurationDays, flightCost, passengerFirstName, passengerLastName }) => {
    return (
        <div>
            <h2>Reserved Travel Information</h2>
            <ul>
                <li><strong>Travel ID:</strong> {travelID}</li>
                <li><strong>Used Companies:</strong> {usedCompanies.join(', ')}</li>
                <li><strong>Visited Planets:</strong> {visitedPlanets.join(', ')}</li>
                <li><strong>Flight Distance:</strong> {flightDistance} km</li>
                <li><strong>Flight Duration (Days):</strong> {flightDurationDays}</li>
                <li><strong>Flight Cost:</strong> ${flightCost}</li>
                <li><strong>Passenger Name:</strong> {passengerFirstName} {passengerLastName}</li>
            </ul>
        </div>
    );
};

export default ReservedTravel;
